INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_01-9291c63a-5ab3-11dc-be42-000e0c431b58', 'Коп01 Эмаль универсальная белая глянцевая 520 мл.', '9291c607-5ab3-11dc-be42-000e0c431b58', 0, 97, 48, 'Высококачественная алкидная эмаль предназначена для окраски предварительно загрунтованных металлических и деревянных поверхностей. Применяется для наружных и внутренних работ. Легко наносится на труднодоступные места, имеет хорошую укрывистость и атмосферостойкость, превосходную адгезию к окрашиваемой поверхности. \r\n', 1);
