INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_01-cf6aa526-48b8-11dd-9342-000e0c431b58', 'Коп01 Эмаль универсальная бронза 520 мл.', '9291c607-5ab3-11dc-be42-000e0c431b58', 0, 84, 38, 'Высококачественная алкидная эмаль предназначена для окраски предварительно загрунтованных металлических и деревянных поверхностей. Применяется для наружных и внутренних работ. Легко наносится на труднодоступные места, имеет хорошую укрывистость и атмосферостойкость, превосходную адгезию к окрашиваемой поверхности. \r\n', 1);
INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_01-d5823752-947b-11e3-8d88-005056be1f7b', 'Коп01 Штукатурка фактурная декоративная с эффектом "шубы" Белый 15кг', '27566c6a-9ed8-11e3-96ad-005056be1f7b', 0, 44, 14, 'Готовая к применению декоративная штукатурка повышенной белизны на основе водной акриловой дисперсии. Образует на поверхности рельеф в виде «шубы». Скрывает небольшие неровности основания. Легко наносится валиком. Создает прочное влагостойкое, паропроницаемое покрытие, стойкое к атмосферным воздействиям и эксплуатационным нагрузкам. Обладает отличной адгезией к поверхностям из бетона, камня, гипса, цемента, кирпича, ДСП, ДВП. Не содержит растворителей, без запаха. Допускает мытье окрашенной поверхности.', 1);
INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_01-da49edc1-58f9-11e0-894e-000e0c431b58', 'Коп01 Грунт-эмаль по ржавчине белая 10л  DALI', '01f691f2-87cd-11de-8f0e-000e0c431b58', 0, 0, 0, 'Применяется для наружных и внутренних работ для окрашивания цветных металлов, оцинкованного металла и нержавеющей стали. Металлическую поверхность, обработанную грунт-эмалью, эффективно защищает от образования коррозии и создает атмосферостойкое, водостойкое покрытие.', 1);
