INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_03-076d216b-4380-11de-8f53-000e0c431b58', 'Коп03 Колер Лакра №  1  Темно-корич. 100 мл', '076d216a-4380-11de-8f53-000e0c431b58', 0, 136, 90, 'Колер позволяет получать светлые оттенки, не оказывая влияния на глянец лакокрасочного покрытия. Предназначен для тонирования красок, штукатурок и шпатлевок на водной основе. Для декорирования фасадных поверхностей возможно использовать в концентрированном виде.', 1);
