INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_03-e242e97f-f29b-11dd-9439-000e0c431b58', 'Коп03 Краска ВД акриловая фасадная всесезонная База А DALI 9л (Рогнеда)', 'a6f80c91-516a-11dd-a89a-000e0c431b58', 0, 71, 17, 'КРАСКА ДАЛИ ФАСАДНАЯ ВСЕСЕЗОННАЯ DALI органорастворимая предназначена для высококачественной отделки фасадов при температуре воздуха до -20 С. Может применяться для ответственного окрашивания поверхностей на основе бетона, штукатурки, ДСП, ацеита, кирпича, пенобетона, дерева во всех климатических поясах, в том числе и в регионах со сложными атмосферными условиями. ', 1);
INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_03-e4020814-4598-11e1-8212-001cc494be80', 'Коп03 Краска ВД латексная д/кухни и ванной DALI 9л БАЗА С (Рогнеда)', 'a6f80c91-516a-11dd-a89a-000e0c431b58', 0, 0, 0, 'Латексная акриловая краска для декоративного окрашивания стен и потолков в жилых и общественных помещениях с повышенной влажностью воздуха и эксплуатационной нагрузкой. Применяется внутри помещений по минеральным поверхностям (бетон, кирпич, гипс, цемент, гипсокартон, шпатлевка, штукатурка и др.).', 1);
