INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_04-0916172c-947c-11e3-8d88-005056be1f7b', 'Коп04 Штукатурка структурная декоративная с эффектом "зернистости" размер "зерна" 2мм Белый 15кг', '27566c6a-9ed8-11e3-96ad-005056be1f7b', 0, 46, 14, 'Для декоративной отделки поверхностей внутри и снаружи помещений. Готовая к применению декоративная штукатурка повышенной белизны на основе водной акриловой дисперсии с равномерно зернистой структурой. Скрывает небольшие неровности основания. Легко наносится. Образуемый рельеф получается плавным и приятным на ощупь. Создает прочное влагостойкое, паропроницаемое покрытие, стойкое к атмосферным воздействиям и эксплуатационным нагрузкам. Обладает отличной адгезией к поверхностям из бетона, камня, гипса, цемента, кирпича, ДСП, ДВП. Не содержит растворителей, без запаха. Размер зерна ~ 1,5 мм. Допускает мытье окрашенной поверхности.', 1);
INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_04-129c7f4d-5273-11de-8f53-000e0c431b58', 'Коп04 Краска ВД акриловая д/стен и потолков (PROFESSIONAL) DALI 9л (Рогнеда)', 'a6f80c91-516a-11dd-a89a-000e0c431b58', 0, 262, 32, 'КРАСКА ДАЛИ ДЛЯ СТЕН И ПОТОЛКОВ предназначена для декоративного и экологичного окрашивания стен и потолков внутри помещений с повышенной эксплуатационной нагрузкой. Применяется для окраски кирпичных, бетонных, оштукатуренных и других минеральных поверхностей.', 1);
INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_04-13ce3df2-93b0-11e3-82a4-005056be1f7b', 'Коп04 Грунт-эмаль по ржавчине синий 2л  DALI', '01f691f2-87cd-11de-8f0e-000e0c431b58', 0, 44, 19, 'Применяется для наружных и внутренних работ для окрашивания цветных металлов, оцинкованного металла и нержавеющей стали. Металлическую поверхность, обработанную грунт-эмалью, эффективно защищает от образования коррозии и создает атмосферостойкое, водостойкое покрытие.', 1);
INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_04-1bd57597-93b0-11e3-82a4-005056be1f7b', 'Коп04 Грунт-эмаль по ржавчине синий 0,75л  DALI', '01f691f2-87cd-11de-8f0e-000e0c431b58', 0, 39, 25, 'Применяется для наружных и внутренних работ для окрашивания цветных металлов, оцинкованного металла и нержавеющей стали. Металлическую поверхность, обработанную грунт-эмалью, эффективно защищает от образования коррозии и создает атмосферостойкое, водостойкое покрытие.', 1);
