INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_04-e4020814-4598-11e1-8212-001cc494be80', 'Коп04 Краска ВД латексная д/кухни и ванной DALI 9л БАЗА С (Рогнеда)', 'a6f80c91-516a-11dd-a89a-000e0c431b58', 0, 0, 0, 'Латексная акриловая краска для декоративного окрашивания стен и потолков в жилых и общественных помещениях с повышенной влажностью воздуха и эксплуатационной нагрузкой. Применяется внутри помещений по минеральным поверхностям (бетон, кирпич, гипс, цемент, гипсокартон, шпатлевка, штукатурка и др.).', 1);
