INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_08-047805a5-fe8c-11e3-bbdb-005056be1f7b', 'Коп08 Краска ВД акриловая д/стен и потолков (PROFESSIONAL) База С DALI 2,5л (Рогнеда)', 'a6f80c91-516a-11dd-a89a-000e0c431b58', 0, 14, 7, 'КРАСКА ДАЛИ ДЛЯ СТЕН И ПОТОЛКОВ предназначена для декоративного и экологичного окрашивания стен и потолков внутри помещений с повышенной эксплуатационной нагрузкой. Применяется для окраски кирпичных, бетонных, оштукатуренных и других минеральных поверхностей.', 1);
INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_08-04834f06-93b0-11e3-82a4-005056be1f7b', 'Коп08 Грунт-эмаль по ржавчине красный 2л  DALI', '01f691f2-87cd-11de-8f0e-000e0c431b58', 0, 14, 19, 'Применяется для наружных и внутренних работ для окрашивания цветных металлов, оцинкованного металла и нержавеющей стали. Металлическую поверхность, обработанную грунт-эмалью, эффективно защищает от образования коррозии и создает атмосферостойкое, водостойкое покрытие.', 1);
