INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_08-b182dc51-f994-11e2-98ef-005056be3574', 'Коп08 Молотковая грунт-эмаль по ржавчине зеленая 0,75л  DALI', '01f691f2-87cd-11de-8f0e-000e0c431b58', 0, 42, 26, 'Применяется по любым металлическим поверхностям: решетки, ограды, гаражи, различные металлоконструкции, автомобильные детали и др. внутри помещений и в условиях атмосферного воздействия.', 1);
INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_08-b7e28649-21de-11df-860d-000e0c431b58', 'Коп08 Краска фактурная Белый 9 кг ("Лакра")', '27566c6a-9ed8-11e3-96ad-005056be1f7b', 0, 11, 21, 'Краска представляет собой белую вязкую однородную массу. Удобна в нанесении, легка в обработке, имеет высокую адгезию к основанию. После высыхания краска образует декоративное рельефное покрытие, скрывающие мелкие дефекты стен. Отличается высокой твердостью и атмосферостойкостью. Возможно последующее нанесение воднодисперсионной краски другого цвета на высохшее фактурное покрытие. Готова к применению.', 1);
