INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_09-963b6b0a-04a8-11e3-94de-005056be3574', 'Коп09 Штукатурка роллерная декоративная с эффектом "короеда" Белый 15кг', '27566c6a-9ed8-11e3-96ad-005056be1f7b', 0, 68, 14, 'Штукатурка фактурная ЛАКРА с эффект "короеда", готовая к применению декоративная штукатурка повышенной белизны на основе водной акриловой дисперсии. Легко наносится валиком. Создает прочное влагостойкое, паропроницаемое покрытие, стойкое к атмосферным воздействиям и эксплуатационным нагрузкам. Обладает отличной адгезией к поверхностям из бетона, камня, гипса, цемента, кирпича, ДСП, ДВП. Не содержит растворителей, без запаха. Допускает мытье окрашенной поверхности. Колеруется в светлые оттенки.', 1);
INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_09-992163db-a731-11de-90d4-000e0c431b58', 'Коп09 Краска ВД акриловая д/потолков DALI 9л (Рогнеда)', 'a6f80c91-516a-11dd-a89a-000e0c431b58', 1, 196, 30, 'КРАСКА ДАЛИ АКРИЛОВАЯ ДЛЯ ПОТОЛКОВ Предназначена для декоративного окрашивания потолков в сухих жилых и общественных помещениях с низкой эксплуатационной нагрузкой.', 1);
INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_09-992163dd-a731-11de-90d4-000e0c431b58', 'Коп09 Краска ВД латексная д/кухни и ванной DALI 9л БАЗА А (Рогнеда)', 'a6f80c91-516a-11dd-a89a-000e0c431b58', 0, 96, 26, 'Латексная акриловая краска для декоративного окрашивания стен и потолков в жилых и общественных помещениях с повышенной влажностью воздуха и эксплуатационной нагрузкой. Применяется внутри помещений по минеральным поверхностям (бетон, кирпич, гипс, цемент, гипсокартон, шпатлевка, штукатурка и др.).', 1);
INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_09-a6f80c96-516a-11dd-a89a-000e0c431b58', 'Коп09 Краска ВД акриловая д/обоев DALI 2,5л (Рогнеда)', 'a6f80c91-516a-11dd-a89a-000e0c431b58', 0, 197, 35, 'Краска DALI акриловая для обоев обладает отличной адгезией к бумажным, флизелиновым и стеклообоям. Благодаря специально разработанному составу, краска DALI обладает хорошей укрывистостью и без проблем наносится на обои под покраску, сохраняя фактуру. Так же краска DALI может быть нанесена на минеральные поверхности, такие как гипсокартон, штукатурки, шпатлевки и тому подобные покрытия. Единственным условием к поверхности - нормальная влажность и температура в помещении, в котором производятся работы. Краска Dali содержит в составе специальные антибактериальные добавки, препятствующие образованию и размножению био организмов и бактерий. Кроме того краска DALI устойчива к влажной уборке и применению моющих средств, что делает стены и потолок помещения долговечными. Существуют две разновидности краски DALI - база А, подходящая и для машинной и для ручной колеровки, и база С, подходящая только для машинной колеровки. Купить и заколеровать краску DALI, а так же другую продукцию компании Рогнеда Вы можете в интернет магазине СтройБери, а так же в сети розничных магазинов.', 1);
