INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_00-82ebcce8-bce7-11e4-a1f3-005056be1f7b', 'Коп00 Молотковая грунт-эмаль по ржавчине серебристая 10 л  DALI', '01f691f2-87cd-11de-8f0e-000e0c431b58', 0, 0, 0, 'Применяется по любым металлическим поверхностям: решетки, ограды, гаражи, различные металлоконструкции, автомобильные детали и др. внутри помещений и в условиях атмосферного воздействия.', 1);
INSERT INTO `ShopItems` (`id`, `itemName`, `group`, `action`, `amount`, `minAmount`, `description`, `shown`) VALUES('copy_00-9291c63a-5ab3-11dc-be42-000e0c431b58', 'Коп00 Эмаль универсальная белая глянцевая 520 мл.', '9291c607-5ab3-11dc-be42-000e0c431b58', 0, 97, 48, 'Высококачественная алкидная эмаль предназначена для окраски предварительно загрунтованных металлических и деревянных поверхностей. Применяется для наружных и внутренних работ. Легко наносится на труднодоступные места, имеет хорошую укрывистость и атмосферостойкость, превосходную адгезию к окрашиваемой поверхности. \r\n', 1);
